16-11-28 05:08:26','Cyber Monday discount!','For those who have missed all the Black Friday action - no need to worry. Use the code CM16 to get 20% off on any Aheadworks extensions. Today and tomorrow only!','https://ecommerce.aheadworks.com/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=CM16',0,0),(225,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.','',0,0),(226,1,'2016-01-20 16:47:19','Important: New Security Patch (SUPEE-7405) and Release – 1/20/2016','Today, we are releasing a new patch (SUPEE-7405) and Community Edition 1.9.2.3 to improve the security of Magento sites. There are no confirmed attacks related to the security issues, but certain vulnerabilities can potentially be exploited to access customer information or take over administrator sessions. You can download the patch and release from the Community Edition Download Page and learn more at https://magento.com/security/patches/supee-7405. ','https://magento.com/security/patches/supee-7405',0,0),(227,1,'2016-02-24 02:36:43','Important: Updates to SUPEE-7405 Security Patch and Release – 2/23/2016','Updated versions of the recent SUPEE-7405 patch and Community Edition 1.9.2.3 release are now available. The updates add support for PHP 5.3 and address issues with upload file permissions, merging carts, and SOAP APIs experienced with the original release. They DO NOT address any new security issues, but all merchants should upgrade to the new versions to maintain compatibility with future releases. You can learn more about the updates at https://magento.com/security/patches/supee-7405','https://magento.com/security/patches/supee-7405',0,0),(228,1,'2016-03-30 18:55:07','Protect Your Business from Brute-Force Password Guessing Attacks','We just posted an article on the Magento Security Center that shares best practices for protecting stores from brute-force password guessing attacks. We’ve recently been made aware of a rise in these attacks, so we strongly recommend that you review the approaches outlined in this article with your developer and hosting provider immediately and implement the ones that are best suited to your unique situation. Learn more at https://magento.com/security/best-practices/protect-your-magento-installation-password-guessing ','https://magento.com/security/best-practices/protect-your-magento-installation-password-guessing ',0,0),(229,4,'2016-06-23 11:14:34','Increase your sales and productivity, while simplifying PCI compliance with exciting new Magento Community Edition 2.1 features.','Shoppers can now check out faster using credit cards stored with PayPal and a redesigned PayPal checkout. PCI compliance is easier thanks to Braintree Hosted Fields. Admin tools are redesigned to help you work more efficiently. Upgrade to Enterprise Edition for new Content Staging and Preview and Enhanced Site Search capabilities.','https://magento.com/blog/magento-news/magento-enterprise-edition-21-unleashes-power-marketers-and-merchandisers ',0,0),(230,1,'2016-10-12 15:00:13','Community Edition 1.9.3 and SUPEE-8788 Provide Critical Security & Functional Updates – 10/12/2016','Community Edition 1.9.3 and SUPEE-8788 resolve multiple security issues, including critical vulnerabilities with certain payment methods and Zend Framework libraries. Community Edition 1.9.3 also includes over 120 product quality enhancements and support for PHP 5.6. Learn more about the security issues at https://magento.com/security/patches/supee-8788 and functional updates at http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1930 ','https://magento.com/security/patches/supee-8788 ',0,0),(231,1,'2016-10-25 11:21:10','Dirty COW Linux OS Vulnerability – 10/25/2016','Dirty COW (CVE-2016-5195) is a serious vulnerability affecting most Linux Operating Systems that can be exploited to gain root access to the server. More information on how to immediately update your Linux OS is available in the Magento Security Center at https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability. ','https://magento.com/security/vulnerabilities/new-linux-operating-system-vulnerability',0,0),(232,4,'2016-11-14 15:38:04','Community Edition 1.9.3.1 is Now Available – 11/14/2016','Community Edition 1.9.3.1 addresses issues encountered by some merchants in our October 12 product releases. All merchants should either upgrade to Community Edition 1.9.3.1 or apply our latest patch, SUPEE-8788, to close several serious security vulnerabilities. More information is available in the release notes at: http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1931 ','http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html#ce19-1931 ',0,0),(233,1,'2017-01-13 21:03:20','New Zend Framework Security Vulnerability – 1/13/2017','We’ve found a new vulnerability in a Zend Framework 1 and 2 email component used by all Magento 1 and Magento 2 software (as well as other PHP solutions). This vulnerability is serious and can lead to a remote code execution attack if your servers use Sendmail as a mail transport agent. Learn how to protect your sites at https://magento.com/security/news/new-zend-framework-1-security-vulnerability\n\n','https://magento.com/security/news/new-zend-framework-1-security-vulnerability',0,0),(234,4,'2017-01-19 11:28:24','New Magento DevBox Beta Speeds Magento 2 Setup – 1/19/2017','Magento DevBox Beta makes it faster and easier than ever to setup your Magento 2 development environment. Read our blog post to find out more at: https://magento.com/blog/technical/set-your-magento-2-development-environment-faster.','https://magento.com/blog/technical/set-your-magento-2-development-environment-faster',0,0),(235,1,'2017-02-07 14:33:15','Community Edition 1.9.3.2 and SUPEE-9652 Resolve Zend Framework Security Issue – 2/7/2017','Community Edition 1.9.3.2 and the SUPEE-9652 patch resolve the recent Zend Framework 1 Security vulnerability. Review the Magento Security Center post for more information:  https://magento.com/security/patches/supee-9652','https://magento.com/security/patches/supee-9652',0,0),(236,4,'2017-02-17 15:37:28','Inspirational athlete, Serena Williams, will join Magento at Imagine 2017.','Imagine 2017 will bring together 3000+ international commerce experts to exchange ideas on the future of commerce. Don’t miss this opportunity to hear from inspirational athlete, Serena Williams, and Stella & Dot CEO, Jessica Herrin. Join us in Las Vegas, April 3-5. Register Now at https://imagine.magento.com/\n','https://imagine.magento.com/',0,0),(237,3,'2017-03-30 08:38:14','New version of Advanced Reports for Magento 2','Now you can filter by customer group and compare sales data for different periods! Use coupon M1M2 to get this product at half price!','https://ecommerce.aheadworks.com/magento-2-extensions/advanced-reports?utm_source=awfeed&utm_medium=zefeed&utm_campaign=AdvReportsm2_2.3v',0,0),(238,3,'2017-03-30 01:48:28','Update of Reward Points for Magento 2','New features added: Email Notifications, Refund to points, Limit points use. Apply coupon M1M2 to get this product at half price!','https://ecommerce.aheadworks.com/magento-2-extensions/points-and-rewards?utm_source=awfeed&utm_medium=zefeed&utm_campaign=RPointsm2_1.1v',0,0),(239,3,'2017-03-14 05:44:55','St.Patrick\'s Sale - 20%Off!','Save your green and get Aheadworks products at lucky prices - 20% off. Use coupon: GREEN17','https://ecommerce.aheadworks.com/magento-extensions.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=Patrick2017',0,0),(240,3,'2017-02-23 03:48:46','Stay current with the latest verions!','Get the latest versions for free! They are available for download from your personal account.','https://ecommerce.aheadworks.com/awlicensing/index/links/?utm_source=awfeed&utm_medium=zefeed&utm_campaign=Plans17',0,0),(241,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.','',0,0),(242,3,'2017-04-06 02:12:54','M2 Subscription and Recurring Payments 1.2.0 released!','Starting now the extension supports PayPal Express, Stripe and Authorize.Net checkout. Use coupon M1M2 to get it at half price!','https://ecommerce.aheadworks.com/magento-2-extensions/subscriptions-and-recurring-payments?utm_source=awfeed&utm_medium=zefeed&utm_campaign=SARPm2_1.2v',0,0),(243,3,'2017-04-04 03:58:14','10 additional report units at 55%OFF!','Boost your reporting: get 10 additional reports at 55%OFF! Gain from extra metrics and get more accurate results.','https://ecommerce.aheadworks.com/magento-extensions/advanced-reports-extended-pack.html?utm_source=awfeed&utm_medium=zefeed&utm_campaign=AdvReportsM1',0,0),(244,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.','',0,0),(245,4,'2008-11-07 23:16:42','Reminder: Change Magento`s default phone numbers and callouts before site launch','Before launching your Magento store, please remember to change Magento`s default phone numbers that appear in email templates, callouts, templates, etc.','',0,0);
