INSERT INTO `cms_block` VALUES (1,'Footer Links','footer_links','\n<ul>\n    <li><a href=\"{{store direct_url=\"about-magento-demo-store\"}}\">About Us</a></li>\n    <li><a href=\"{{store direct_url=\"customer-service\"}}\">Customer Service</a></li>\n<li class=\"last privacy\"><a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy</a></li>\r\n</ul>','2015-12-25 03:35:19','2015-12-25 03:35:20',1),(2,'Footer Links Company','footer_links_company','\n<div class=\"links\">\n    <div class=\"block-title\">\n        <strong><span>Company</span></strong>\n    </div>\n    <ul>\n        <li><a href=\"{{store url=\"\"}}about-magento-demo-store/\">About Us</a></li>\n        <li><a href=\"{{store url=\"\"}}contacts/\">Contact Us</a></li>\n        <li><a href=\"{{store url=\"\"}}customer-service/\">Customer Service</a></li>\n        <li><a href=\"{{store url=\"\"}}privacy-policy-cookie-restriction-mode/\">Privacy Policy</a></li>\n    </ul>\n</div>','2015-12-25 03:35:19','2015-12-25 03:35:19',1),(3,'Cookie restriction notice','cookie_restriction_notice_block','<p>This website requires cookies to provide all of its features. For more information on what data is contained in the cookies, please see our <a href=\"{{store direct_url=\"privacy-policy-cookie-restriction-mode\"}}\">Privacy Policy page</a>. To accept cookies from this site, please click the Allow button below.</p>','2015-12-25 03:35:20','2015-12-25 03:35:20',1),(4,'Parallax Content 01','parallax-content-01','\r\n<div class=\"inner-parallax-content\">\r\n\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 \">\r\n<div class=\"block-1 block-item\">\r\n<div class=\"content\">\r\n<h2>Peace + Love</h2>\r\n<p>Capturing the drama and high-octane lifestyle of the lavish <br />and famous, Peace + Love is for the fierce. The untouchable<br /> and the powerful.</p>\r\n<div class=\"button\"><a class=\"btn2\" href=\"#\">SHOP THE COLLECTION </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 \">\r\n<div class=\"block-2 block-item\">\r\n<div class=\"content\">\r\n<h2>Coats &amp; Jackets</h2>\r\n<p>From the love-forever faux leather biker jacket and the never<br /> fail trench coats to faux fur gilets and the ever so coveted<br /> cocoon coat shape, we have something for any style right<br /> here.</p>\r\n<div class=\"button\"><a class=\"btn2\" href=\"#\">SHOP COATS</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-lg-4 col-md-4 col-sm-4 col-xs-4 \">\r\n<div class=\"block-3 block-item\">\r\n<div class=\"content\">\r\n<h2>Boot-iful</h2>\r\n<p>Boots look good at any time of the year but we&rsquo;re especially<br /> lovin&rsquo; &lsquo;em right now. Spot a hot trend and submit it for votes.<br /> You will get it FREE if it got produced!</p>\r\n<div class=\"button\"><a class=\"btn2\" href=\"#\">SHOP BOOTS</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2015-12-25 03:59:40','2016-01-12 21:48:54',1),(5,'Banner Block 01','banner_block_01','<div class=\"bann-block01\">\r\n<div class=\"inner-block\">\r\n<div class=\"col-lg-6 col-xs-12 block-section\">\r\n<div class=\"inner-block\">\r\n<div class=\"images\"><img alt=\"\" src=\"{{media url=\"wysiwyg/magenthemes/mtfastion/images/block_slide1.jpg\"}}\" /></div>\r\n<div class=\"content\">\r\n<h2>shoes</h2>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"col-lg-6 col-xs-12\">\r\n<div class=\"inner-block block-section\">\r\n<div class=\"images\"><img alt=\"\" src=\"{{media url=\"wysiwyg/magenthemes/mtfastion/images/block_slide2.jpg\"}}\" /></div>\r\n<div class=\"content\">\r\n<h2>bags</h2>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>','2015-12-25 04:04:56','2015-12-25 04:09:01',1),(6,'Header Text Content','header-text-content','<div class=\"content-left\">\r\n<div class=\"icon\"><i class=\"fa fa-paper-plane\"></i></div>\r\n<div class=\"content-text\">\r\n<h4>Free shipping worldwide</h4>\r\n<p>Over $50 now fully tracked</p>\r\n</div>\r\n </div>','2015-12-25 04: