INSERT INTO `cms_page` VALUES (1,'404 Not Found 1','two_columns_right','Page keywords','Page description','no-route',NULL,'\n<div class=\"page-title\"><h1>Whoops, our bad...</h1></div>\n<dl>\n    <dt>The page you requested was not found, and we have a fine guess why.</dt>\n    <dd>\n        <ul class=\"disc\">\n            <li>If you typed the URL directly, please make sure the spelling is correct.</li>\n            <li>If you clicked on a link to get here, the link is outdated.</li>\n        </ul>\n    </dd>\n</dl>\n<dl>\n    <dt>What can you do?</dt>\n    <dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd>\n    <dd>\n        <ul class=\"disc\">\n            <li><a href=\"#\" onclick=\"history.go(-1); return false;\">Go back</a> to the previous page.</li>\n            <li>Use the search bar at the top of the page to search for your products.</li>\n            <li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a>\n            <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li>\n        </ul>\n    </dd>\n</dl>\n','2015-12-25 03:35:19','2015-12-25 03:35:19',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(2,'MT Fastion - Responsive Magento Ecommerce Theme','one_column',NULL,NULL,'home',NULL,'<!--<div class=\"page-title\">\r\n<h2>Home Page</h2>\r\n</div>\r\n-->','2015-12-25 03:35:19','2015-12-29 23:24:30',1,0,'<!--<reference name=\"content\">\r\n        <block type=\"catalog/product_new\" name=\"home.catalog.product.new\" alias=\"product_new\" template=\"catalog/product/new.phtml\" after=\"cms_page\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_viewed\" name=\"home.reports.product.viewed\" alias=\"product_viewed\" template=\"reports/home_product_viewed.phtml\" after=\"product_new\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n        <block type=\"reports/product_compared\" name=\"home.reports.product.compared\" template=\"reports/home_product_compared.phtml\" after=\"product_viewed\">\r\n            <action method=\"addPriceBlockType\">\r\n                <type>bundle</type>\r\n                <block>bundle/catalog_product_price</block>\r\n                <template>bundle/catalog/product/price.phtml</template>\r\n            </action>\r\n        </block>\r\n    </reference>\r\n    <reference name=\"right\">\r\n        <action method=\"unsetChild\"><alias>right.reports.product.viewed</alias></action>\r\n        <action method=\"unsetChild\"><alias>right.reports.product.compared</alias></action>\r\n    </reference>-->',NULL,NULL,NULL,NULL,NULL),(3,'About Us','two_columns_right',NULL,NULL,'about-magento-demo-store',NULL,'<section class=\"post_content clearfix\">\r\n<p>Founded in 2008, <a href=\"#\">CleverSoft</a> quickly confirmed its position as one of the innovative young companies in the field of&nbsp; <a title=\"Website Design &amp; Development\" href=\"#\">Website Design &amp; Development</a>, <a title=\"Online Marketing\" href=\"http://cleversoft.co/online-marketing/\">Online Marketing</a> and <a title=\"Training Services\" href=\"#\">Training Services</a>. Our experience, expertise, best-equipped facility, professional management and commitment have been bringing our customers utmost satisfaction and in return rewarded us with rapid and sustainable growths over the past 5 years.</p>\r\n<p>We focus on creating cutting edge designs using the latest in web technologies and tools. With every new project, we take the opportunity to discover new innovative potential. The excitement of the next web project, never ceases to exist as we challenge our creative think tanks to give every web site that &ldquo;WOW&rdquo; factor, our clients so keenly search for. We do make the web a better looking place and can help you achieve the same with your web site. We curb our insight, dedication and expertise to challenge the boundaries of creativity and deliver on tomorrow&rsquo;s capabilities.</p>\r\n<p>CleverSoft&rsquo; guiding rule is very simple, we offer expert skill, innovative creations, full commitment, assets and excellent customer support to all our clients and help them to progress their business to the peak.</p>\r\n<h2>Professionalism</h2>\r\n<p>We value professionalism by all employees. We develop our staff to perform their work with expertise, dedication and care. At CleverSoft, monthly performance appraisal is applied so that the professionalism is deeply understood and conduct on every staff.</p>\r\n<h2>Improvement</h2>\r\n<p>We promote a learning environment by challenging new approaches to problem solving, exploring new methods and testing new ideas. Continuous improvement is evidenced in every facet of our business, from managing to controlling processes, from production to delivering. This powerful system encourages participation, maintains employee interest and improves overall morale. It sharpens the focus of the organization and contributes to improved quality, efficiency, and ultimately, a highly satisfied customer.</p>\r\n</section>','2015-12-25 03:35:19','2016-01-07 03:55:15',1,0,NULL,NULL,NULL,NULL,NULL,NULL),(4,'Customer Service','three_columns',NULL,NULL,'customer-service',NULL,'<div class=\"page-title\">\n<h1>Customer Service</h1>\n</div>\n<ul class=\"disc\">\n<li><a href=\"#answer1\">Shipping &amp; Delivery</a></li>\n<li><a href=\"#answer2\">Privacy &amp; Security</a></li>\n<li><a href=\"#answer3\">Returns &amp; Replacements</a></li>\n<li><a href=\